            this.label79.Text = "- 가계부 메뉴에서는 등록하기를 원하는 년/월/일을 선택하고, 카드인지, 현금인지, 계좌는 어떤 계좌에서 돈을 지출하고, 입금할 것인지, 내역은 " +
